ads.description:
Dzień dobrym, mam do sprzedania samochód osobowy marki Suzuki Swift wyprodukowany w 2009 roku, który został wyposażony w silnik wysokoprężny turbodoładowany o pojemności 1248 cm3, legitymujący się mocą 75 KM, który pokonał do tej pory 235000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Suzuki prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się bardzo dobrze, jest czyste, zadbane.



Swift jest wyposażenia w:

- Klimatyzację;

- ABS z ESP;

- Centralny zamek;

- Elektryczne szyby przednie;

- Elektryczne lusterka;

- 2 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 25.08.2025 roku.

Przegląd techniczny 21.08.2025 roku.
